import React from "react";
import "./styles.css";

const App = () => {
  const message = "This is our React app - it's great";

  const handelClick = () => {
    alert("you clicked a message");
  }

  return(
    <div>
      <h1> Hello React World</h1>
      <h2 onClick={handelClick}>
        {message}
      </h2>
    </div>
  );
}

export default App;
